import Head from 'next/head';
import Layout from '../components/Layout';
import HeroImage from '../components/HeroImage';
import Header from '../components/Header';

const Index = (props) => {
  return (
    <Layout>
      <Head>
        <title>Next.js Proyect - HOME</title>
      </Head>
      <HeroImage />
      <Header />
    </Layout>
  );
};

export default Index;
